import Link from 'next/link';
import React from 'react';

function TopNav(props) {
  return (
    <div className='top-nav'>
      <h1>THE<br></br>SHADZ</h1>
      <span className="top-nav__items">TOP NAV ITEMS</span>
    </div>
  );
}

export default TopNav;
